import "./App.css";

function App() {
  const name = "Ahmed";
  const age = 20;
  const email = "ahmedabdi03@hotmail.com";

  return (
    <div className="App">
      <h1>{name}</h1>
      <h1>{age}</h1>
      <h1>{email}</h1>
    </div>
  );
}

export default App;
